"""### Part II Build recommender system with Keras

In this part, we will implement the generalized matrix factorization model. The steps in the model are as follows:


1. Map user ID to a "user vector" (can be considered as user embedding) via an embedding matrix
2. Map movie ID to a "movie vector" (camn be considered as movie embedding) via an embedding matrix
3. Compute the dot product between the user vector and movie vector, to obtain the a match score between the user and the movie (predicted rating).
4. Train the embeddings and the rest of the network via gradient descent using all known user-movie pairs.

We first change user_id to values between 0 and `num_users -1` and item_id to values between 0 and `num_items - 1`. We need this new encoding to feed the data into the embedding layers in a neural network later
"""

from sklearn.preprocessing import LabelEncoder

user_enc = LabelEncoder()
data_df['user_id'] = user_enc.fit_transform(data_df['user_id'].values)
num_users = data_df['user_id'].nunique()
item_enc = LabelEncoder()
data_df['item_id'] = item_enc.fit_transform(data_df['item_id'].values)
num_movies = data_df['item_id'].nunique()
data_df['rating'] = data_df['rating'].values.astype(np.float32)
min_rating = min(data_df['rating'])
max_rating = max(data_df['rating'])
print(min_rating, max_rating)

"""Split into training and testing data as before:"""

train_df, test_df = train_test_split(data_df, test_size=0.2, random_state=42)
print("Train size:", train_df.shape)    # 80.00%
print("Test size:", test_df.shape)      # 20.00%

X_train = train_df[['user_id', 'item_id']].values
y_train = train_df['rating'].values
X_test = test_df[['user_id', 'item_id']].values
y_test = test_df['rating'].values

X_train.shape, X_test.shape, y_train.shape, y_test.shape

X_train_array = [X_train[:, 0], X_train[:, 1]]
X_test_array = [X_test[:, 0], X_test[:, 1]]

"""#### Build the generalized matrix factorization model

We first build a generalized matrix factorization model using Keras. Basically we learn user and item embeddings using Embedding layer in Keras and calculate ratings as the product of user and item embeddings.

![image.png](data:image/png;base64,)

![image.png](data:image/png;base64,)
"""

from keras.models import Model
from keras.layers import Input, Reshape, Dot, Embedding
from keras.regularizers import l2
from keras.activations import sigmoid

# number of latent factors in the embedding space
num_factors = 50

user = Input(shape=(1,), name='user-input')
u = Embedding(num_users, 
              num_factors, 
              embeddings_initializer='he_normal',
              embeddings_regularizer=l2(1e-6),
              name='user-embedding')(user)
u = Reshape((num_factors,), name='user-flatten')(u)
    
movie = Input(shape=(1,), name='movie-input')
m = Embedding(num_movies, 
              num_factors, 
              embeddings_initializer='he_normal',
              embeddings_regularizer=l2(1e-6),
              name='movie-embedding')(movie)
m = Reshape((num_factors,), name='movie-flatten')(m)
    
rating = Dot(axes=1, name='dot-product')([u, m])
# Convert to rating scale.
converted_rating = sigmoid(rating) * 5
model = Model(inputs=[user, movie], outputs=converted_rating)
model.compile(loss='mean_squared_error', 
              optimizer='adam')

model.summary()

from IPython.display import SVG
from keras.utils.vis_utils import model_to_dot

SVG(model_to_dot(model, show_shapes=True, dpi=80).create(prog='dot', format='svg'))

history = model.fit(X_train_array, y_train, validation_split = 0.2, epochs=5)

loss = model.evaluate(X_test_array, y_test)

print("RMSE (test data) = ", math.sqrt(loss))

"""#### Build the neural collaborative filtering model

Next, we build a neural collaborative filtering model, similar to the one described here in Figure 2 from [Neural Collaborative Filtering](https://dl.acm.org/doi/pdf/10.1145/3038912.3052569)

![image.png](data:image/png;base64,)
"""

from keras.layers import Embedding, Flatten, Input, concatenate, Dropout, Dense
from keras.activations import sigmoid

num_factors = 50
movie_input = Input(shape=[1],name='movie-input')
movie_embedding = Embedding(num_movies, 
                            num_factors, 
                            name='movie-embedding')(movie_input)
movie_vec = Flatten(name='movie-flatten')(movie_embedding)

user_input = Input(shape=[1],name='user-input')
user_embedding = Embedding(num_users, 
                           num_factors, 
                           name='user-embedding')(user_input)
user_vec = Flatten(name='user-flatten')(user_embedding)

concat = concatenate([movie_vec, user_vec], name='movie-user-concat')

concat_dropout = Dropout(0.2)(concat)
fc_1 = Dense(100, name='fc-1', activation='relu')(concat)
fc_1_dropout = Dropout(0.2, name='fc-1-dropout')(fc_1)
fc_2 = Dense(50, name='fc-2', activation='relu')(fc_1_dropout)
fc_2_dropout = Dropout(0.2, name='fc-2-dropout')(fc_2)
rating = Dense(1, name='rating')(fc_2_dropout)
# Convert to rating scale.
converted_rating = sigmoid(rating) * 5
model = Model([user_input, movie_input], converted_rating)
model.compile(loss = 'mean_squared_error', optimizer='adam')

model.summary()

SVG(model_to_dot(model, show_shapes=True, dpi=80).create(prog='dot', format='svg'))

history = model.fit(X_train_array, y_train, validation_split = 0.2, epochs=5)

loss = model.evaluate(X_test_array, y_test)

print("RMSE (test data) = ", math.sqrt(loss))